import math
def G6():
    alpha = ['a', 'b', 'c', 'd', 'e', 'f', 'g', 'h', 'i', 'j', 'k', 'l', 'm', 'n', 'o', 'p', 'q', 'r', 's', 't']
    def make(n):
        cnt = 0
        digit = 1
        used = set()
        ans = ""
        for d in range(1, 20 + 1):
            a = math.factorial(d)
            if n > cnt + a:
                cnt += a
            else:
                digit = d
                break
        for i in range(digit, 0, -1):
            f = math.factorial(i - 1)
            for j in range(digit):
                if alpha[j] not in used:
                    if n > cnt + f:
                        cnt += f
                    else:
                        used.add(alpha[j])
                        ans += alpha[j]
                        break
        return ans

    for i in range(1, 20000 + 1):
        n = i ** 4
        ans = make(n%9099099909999099999)
        if i == 10000:
            ans = "9099099909999099999"
        print("T[" + str(n) + ']="' + ans + '"')

